import React, { Component } from "react";


class Login extends Component{
    render() {
        return (
            <React.Fragment>
                <h3 className="display-1">Hello from login</h3>
            <div className="display-1 loginContainer bg-dark">
                <h3 className="display-1">Hello from loginContainer</h3>
            </div>
            </React.Fragment>
        );
    }
}
export default Login;
